import $ from "jquery";

function clickTesteo(state) {
	console.log( `TestoLog` );
	let loTesteado = $( "input.input_test" ).val();
	console.log( `Test: ${ loTesteado }` );
	const cars = ["Saab", "Volvo", "BMW"];
	state( cars )
};

export { clickTesteo }
